import './style.css'
import React, { useState, useEffect } from 'react'
import Nav from '../Navbar'
import Card from '../Card'
import Form from '../Form'

const url = "https://google-maps-search1.p.rapidapi.com/search";

const options = {
  method: 'POST',
  headers: {
    'content-type': 'application/json',
    'X-RapidAPI-Host': 'google-maps-search1.p.rapidapi.com',
    'X-RapidAPI-Key': '2c027e32bdmshb9b7054156db181p103862jsnd0754bde8547'
  },
  body: '{"limit":3,"language":"en","region":"au","queries":["Top rated Speech therapist, NSW,au"],"coordinates":"37.381315,-122.046148"}'
}

const App = () => {
  const [result, setResult] = useState()

  useEffect(() => {
    const makeApiCall = () => {
      console.log("App-result",result)
      fetch(url, options)
        .then((res) => res.json())
        .then((data) => {
          setResult(data.result[0])
        })
    }
    makeApiCall()
  }, [])
 
  
  return (
    <div className="App">
      <Nav />
      <Form />
      <Card {...result} />
    </div>

  );
}

export default App;
